import React from "react";
import Wrapper from "./components/Wrapper";
import Title from "./components/Title";
import SquidwardCard from "./components/SquidwardCard";
import MrKrabsCard from "./components/MrKrabsCard";
import Card from "./components/Cards";

function App() {
  return (
    <Wrapper>
      <Title>Friends List</Title>
      <Card name="Spongebob" occupation="Fry Cook" location="A Pineapple Under the Sea" imgsrc="https://upload.wikimedia.org/wikipedia/en/thumb/4/47/Spongebob-squarepants.svg/666px-Spongebob-squarepants.svg.png" />
      <MrKrabsCard />
      <SquidwardCard />
    </Wrapper>
  );
}

export default App;
